When Fish Attack

Health-Medical Documentary hosted by Peter Tiling, published by National Geographic in 2013 - English narration


Information
------------------------------

When Fish Attack 
Aquatic animals have the advantage in their environment. And when you enter it, or try to take these creatures out of it, you run some risks. When Fish Attack offers you an in-depth look at some of the most unexpected underwater encounters caught on camera. Travel the world to meet the people who have lived to tell these tales. Each story includes footage of the actual events captured in the field. Experts provide analyses of what happened and high-end CGI fills in the gaps
A blue marlin turns the tables on a fisherman, a shark breaks into a cage, and a leaping fish critically injures a kayaker.

